use std::collections::HashMap;
use itertools::Itertools;
use std::convert::From;

fn decrypt<const CIPHER_LENGTH: usize, const PASSWORD_LENGTH: usize>(cipher: &[u8; CIPHER_LENGTH], pw: &[u8; PASSWORD_LENGTH], sink: &mut [u8; CIPHER_LENGTH]) {
    for (i, c) in cipher.iter().enumerate() {
        sink[i] = c ^ pw[i % PASSWORD_LENGTH];
    }
}

fn test_on_ascii_character<const CIPHER_LENGTH: usize>(decipher: &[u8; CIPHER_LENGTH]) -> bool {
    for e in decipher {
        if *e != 13 && *e != 10 && *e != 9 && (*e < 20 || *e > 127) {
            return false;
        }
    }

    return true;
}

